// Header.js
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

const Header = () => {
  const [isScrolled, setIsScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      const scrollPosition = window.scrollY;
      setIsScrolled(scrollPosition > 50);
    };

    window.addEventListener('scroll', handleScroll);

    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  const headerClass = isScrolled ? 'header opaque' : 'header';

  return (
    <header className={headerClass}>
      <nav className="nav navbar navbar-expand-md mb-4">
      <Link to="/" className="logo navbar-brand">Elizabeth</Link>

      <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarCollapse" aria-controls="navbarCollapse" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div>

        <ul class="nav nav-pills">
        <li class="nav-item"><Link className='nav-link' to="/">Home</Link></li>
        <li class="nav-item"><Link className='nav-link' to="/services">Services</Link></li>
        <li class="nav-item"><Link className='nav-link' to="/contact">Contact</Link></li>
        <li class="nav-item"><Link className='nav-link' to="/testimonials">Testimonials</Link></li>
      </ul>
    </div>
      </nav>
    </header>
  );
};

export default Header;
